import React from "react";
import Card from "./Components/Card";
import SDATA from './SDATA'
let App = () => {
  return (
    <>
      <Card 
      sname={SDATA[0].sName}
      img={SDATA[0].imgSrc}
      title={SDATA[0].title}
      link={SDATA[0].link}
      />
      <Card 
      sname={SDATA[1].sName}
      img={SDATA[1].imgSrc}
      title={SDATA[1].title}
      link={SDATA[1].link}
      />
      <Card 
      sname={SDATA[0].sName}
      img={SDATA[0].imgSrc}
      title={SDATA[0].title}
      link={SDATA[0].link}
      />
    </>
  );
};

export default App;
